class SolutionV2 {
    boolean findit = false;
    int[] capacityArray = new int[26];
    List<Integer> list = new ArrayList<>();
    int totalCharCount;
    static Map<Integer, String> map = new HashMap<>();
    static Map<Character, Integer>[] maplist = new Map[10];
    static String[] strs = new String[] {
            "zero", "one", "two", "three", "four",
            "five", "six", "seven", "eight", "nine"
    };

    static {    // initialize the map
        for (int i = 0; i < strs.length; ++ i) {
            map.put(i, strs[i]);
            maplist[i] = new HashMap<>();
            for (int j = 0; j < strs[i].length(); ++ j) {
                maplist[i].put(strs[i].charAt(j), 1 + maplist[i].getOrDefault(strs[i].charAt(j), 0));
            }
        }
    }

    /// @brief accurate coverage problem, using backtrace here
    public String originalDigits(String s) {
        int lens = totalCharCount = s.length();
        for (int i = 0; i < lens; ++ i) {
            ++ capacityArray[charToInt(s.charAt(i))];
        }
        List<Integer> intermediate = new ArrayList<>();
        backtrace(intermediate);
        // TODO sort "list" in ascending order
        Collections.sort(list);
        StringBuilder ret = new StringBuilder();
        for (Integer ele : list) {
            ret.append(ele.toString());
        }
        return ret.toString();
    }

    /// @brief as its name
    private void backtrace(List<Integer> intermediate) {
        if (findit || totalCharCount < 0) {
            return ;    /// prune
        }
        if (totalCharCount == 0) {
            findit = true;
            list.addAll(intermediate);
            return ;
        }
        for (int i = 0; i <= 9; ++ i) {
            if (fulfill(i)) {
                dec(i);
                intermediate.add(i);
                totalCharCount -= strs[i].length();
                backtrace(intermediate);
                totalCharCount += strs[i].length();
                intermediate.remove(intermediate.size() - 1);
                inc(i);
            }
        }
    }

    private boolean fulfill(int i) {
        Map<Character, Integer> tmp = maplist[i];
        for (Character key : tmp.keySet()) {
            if (tmp.get(key) > capacityArray[charToInt(key)]) {
                return false;
            }
        }
        return true;
    }

    private void inc(int i) {
        Map<Character, Integer> tmp = maplist[i];
        for (Character key : tmp.keySet()) {
            capacityArray[charToInt(key)] += tmp.get(key);
        }
    }

    private void dec(int i) {
        Map<Character, Integer> tmp = maplist[i];
        for (Character key : tmp.keySet()) {
            capacityArray[charToInt(key)] -= tmp.get(key);
        }
    }

    public static int charToInt(Character ch) {
        return (int)ch & 0x1f;
    }
}





class Solution {
    /// @brief naive
    /// @details
    ///         step1: filter 0,2,4,6,8
    ///         step2: filter 5(f4),3(h8),7(s6)
    ///         step3: filter 1(o024), 9(n17/2)
    public String originalDigits(String s) {
        int[] array = new int[26];
        int lens = s.length();
        for (int i = 0; i < lens; ++ i) {
            ++ array[charToIndex(s.charAt(i))];
        }
        int[] count = new int[10];
        count[0] = array[charToIndex('z')];
        count[2] = array[charToIndex('w')];
        count[4] = array[charToIndex('u')];
        count[6] = array[charToIndex('x')];
        count[8] = array[charToIndex('g')];
        count[5] = array[charToIndex('f')] - count[4];
        count[3] = array[charToIndex('h')] - count[8];
        count[7] = array[charToIndex('s')] - count[6];
        count[1] = array[charToIndex('o')] - count[0] - count[2] - count[4];
        count[9] = (array[charToIndex('n')] - count[1] - count[7]) / 2;
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < 10; ++ i) {
            for (int j = 0; j < count[i]; ++ j) {
                sb.append(Integer.valueOf(i).toString());
            }
        }
        return sb.toString();
    }

    // a -> 1, b -> 2, etc.
    public static int charToInt(Character ch) {
        return (int)ch & 0x1f;
    }

    public static int charToIndex(Character ch) {
        return charToInt(ch) - 1;
    }
}

